import Vue from 'vue'
import App from './App.vue'

import data from './constants'
import {example} from "./constants"
import {alertFunction} from './utils'

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')

alert(data.message);
alert(example.text);
